import React, { Component } from 'react';
import fire from './config/fire'
import './App.css';
import {Link} from 'react-router-dom';

class Login extends Component{
    constructor(props){
        super(props);
    }
    handleChange(e){
        this.setState({[e.target.name] : e.target.value});
    }
    render(){
        return (
            <div className="col-md-6">
            <form>
                <div className="form-group">
                <label for="exampleInputEmail">Email Address</label>
                <input value={this.state.email} onChange={this.handleChange} type="email" name="email" class="form-control" id="exampleInputEmail" placeholder="Enter Email"/>
                </div>
                <div className="form-group">
                <label for="exampleInputPassword">Password</label>
                <input value={this.state.password} onChange={this.handleChange} type="password" name="password" class="form-control" id="exampleInputPassword" aria-describedBy="emailHelp" placeholder="Enter Password"/>
                </div>
                <button type="submit" onClick={this.login} class="btn btn-primary">Login</button>
                <button onClick={this.signup} style={{marginLeft : '25px'}} className = "btn btn-sucess">Sign Up</button>
            </form>
            </div>
        );
    }
}

export default Login;
